// Study.js
import React from 'react';
import { Link } from 'react-router-dom';
import './css/./Study.css';

const Study = () => {
    const handleLogout = () => {
        // Add logout functionality here
        alert("Logged out");
    };

    return (
        <>
            {/* Header */}
            <header>
                <div className="container">
                    <Link to="/" className="logo">LearnLinguaAI</Link>
                    <nav>
                        <ul>
                            <li><Link to="/" className="active">Home</Link></li>
                            <li><Link to="/classes">Classes</Link></li>
                            <li><Link to="/about">About</Link></li>
                            <li className="dropdown">
                                <a href="#" className="dropbtn">See More</a>
                                <div className="dropdown-content">
                                    <Link to="/user-profile">Profile</Link>
                                    <Link to="/contact">Contact</Link>
                                    <Link to="/setting">Setting</Link>
                                    <Link to="/teacher">Teacher</Link>
                                    <Link to="/chatbot">Chat</Link>
                                    <a href="#" onClick={handleLogout}>Logout</a>
                                </div>
                            </li>
                        </ul>
                    </nav>
                </div>
            </header>

            {/* Join Section */}
            <section className="join-section">
                <input type="text" placeholder="Enter join code" className="join-input" />
                <button className="join-button">Join</button>
            </section>

            {/* Categories */}
            <main className="categories">
                <Category title="Ice Breaker" />
                <Category title="Math" />
                {/* Add more categories as needed */}
            </main>

            {/* Footer */}
            <footer>
                <div className="container">
                    <p>&copy; 2024 LearnLinguaAI. All Rights Reserved.</p>
                </div>
            </footer>
        </>
    );
};

// Category component
const Category = ({ title }) => {
    return (
        <div className="category">
            <h2>{title}</h2>
            <div className="quiz-cards">
                {/* Example Quiz Cards */}
                <QuizCard title="Around the World" questions={8} plays="80k" />
                <QuizCard title="True or False" questions={12} plays="129k" />
                <QuizCard title="" questions={12} plays="129k" />
                {/* Add more cards as needed */}
            </div>
        </div>
    );
};

// Quiz Card component
const QuizCard = ({ title, questions, plays }) => {
    return (
        <div className="quiz-card">
            <div className="quiz-info">
                <p className="quiz-title">{title}</p>
                <p className="quiz-questions">{questions} Qs</p>
                <p className="quiz-plays">{plays} plays</p>
            </div>
        </div>
    );
};

export default Study;
